import React from "react";
import { useNavigate, Link, Navigate } from "react-router-dom";

function Product() {
  const navigate = useNavigate();
  return (
    <div>
      Product
      <button onClick={() => {
          navigate("/product/create");
        }}
      >
        Add Product{" "}
      </button>
    </div>
  );
}

export default Product;
